    data: |
      SELECT ALL ( - col0 ), + ( + col2 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col2 NOT BETWEEN + - 76 + - ( - - 35 ) AND + 69;
  - name: tab2

outputs:
  - name: q12257.out
    data: |
